  `id` varchar(64) NOT NULL default '' COMMENT '主键',
  `create_by` varchar(64) default NULL COMMENT '制单人',
  `create_date` datetime default NULL COMMENT '制单时间',
  `update_by` varchar(64) default NULL COMMENT '诊断人',
