  `check_info` varchar(1000) default NULL COMMENT '诊断信息',
  `remarks` varchar(255) default NULL COMMENT '备注信息',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='信息反馈表';

