  `mem_tel` varchar(64) default NULL COMMENT '会员手机',
  `remarks` varchar(255) default NULL COMMENT '备注信息',
  `car_id` varchar(32) default NULL COMMENT '车id',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员信息表';

